import React , { Component } from 'react';
import axios from "axios";

class MySubmissionStudent extends Component{

	constructor(){
		super();
		this.state = {
			data : []
		}	
	}

	componentWillMount(){
		axios.post("http://localhost:5000/students/showSubmittedProblems" , {
			student_id : this.props.match.params.id				
		})
		.then(resFromBe => {
			this.setState({
				data : resFromBe.data.data
			})	
		})

	}


    render(){
        return(
            <React.Fragment>
              	<h1>Hello world</h1>
                </React.Fragment>
        )
    }
}


export default MySubmissionStudent;
